import React from 'react';
import './App.css';
// import Amplify, {API, graphqlOperation} from 'aws-amplify';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        Would you like to Subscribe?
        <button>Yes</button>
        <button>No</button>
      </header>
    </div>
  );
}

export default App;
